import { ListGroup } from 'react-bootstrap'
import { List } from '../List/List'

export const TableList = props => {
    const tables = props.tables;
    return (
        <>
            <h1>All tables</h1>
            <ListGroup variant="flush">
                {tables.map(table => 
                <ListGroup.Item 
                    className={'px-0 py-4'} 
                    key={table.id}>
                    <List key={table.id} table={table}/>
                </ListGroup.Item>)}
            </ListGroup>
        </>
    )
}
